function MemoryListItem({ item }) {
  const { imgUrl, option, title, content, badges, memories, like } = item;

  return (
    <div>
      <img src={imgUrl} alt={title} />
      <div>{option}</div>
      <div>{title}</div>
      <div>{content}</div>
      <div>{badges}</div>
      <div>{memories}</div>
      <div>{like}</div>
    </div>
  );
}

function MemoryList({ items }) {
  return <ul></ul>;
}

export default MemoryList;
